import LocationSpecificMetrics from './LocationSpecificMetrics';

export default function LiberalMetrics() {
  return (
    <LocationSpecificMetrics 
      locationId="liberal"
      locationName="Liberal"
      locationColor="from-orange-500 to-orange-600"
    />
  );
}
